class Solution:

    def numBusesToDestination(self, routes: List[List[int]], source: int, target: int) -> int:
        if source == target:
            return 0

        stopToRoutes = collections.defaultdict(list)
        for i, route in enumerate(routes):
            for bStop in route:
                stopToRoutes[bStop].append(i)

        transfers = collections.defaultdict(list)
        for bStop, routes in stopToRoutes.items():
            if len(routes) > 1:
                for r1 in routes:
                    for r2 in routes:
                        if r1 == r2:
                            continue
                        transfers[r1].append(r2)

        startingRoutes = stopToRoutes[source]
        endingRoutes = stopToRoutes[target]

        if list(set(startingRoutes) & set(endingRoutes)):
            # startingRoutes and endingRoutes intersect,
            # meaning there exists at least one route that goes from source to target
            return 1

        currentRoutes = startingRoutes
        seen = set(currentRoutes)
        ans = 0
        # bfs
        while len(currentRoutes) > 0:
            print(f'iteration: {ans}: {len(currentRoutes)}')
            ans += 1
            nextRoutes = []
            # loops through current routes
            for route in currentRoutes:
                # if one of the current route is the target route, return answer
                if route in endingRoutes:
                    return ans

                seen.add(route)
                routeNextRoutes = transfers[route]
                routeNextRoutes = [r for r in routeNextRoutes if r not in seen and r not in currentRoutes]
                # print(f'adding {len(routeNextRoutes)} more next routes')
                nextRoutes.extend(routeNextRoutes)
                # for nextRoute in routeNextRoutes:
                #     if nextRoute not in seen and nextRoute not in currentRoutes:
                #         nextRoutes.append(nextRoute)

            currentRoutes = nextRoutes
            if not currentRoutes:
                print('has no more routes')

        return -1


